// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;
pragma abicoder v2;

import "./feeDwitterManagment.sol";

contract Dwitter is feeDwitterManagment {
  
  Dwitt[] private Dwitters;
  uint characterLimitDwitter;

  struct Dwitt{
    string text;
    address owner;
    uint256 timestamp;
    
    }
   
 mapping (address => uint[]) private ownerDwitter;

  constructor (){
    characterLimitDwitter=140;}

function setNewDwitter(string memory _messaggio) external payable stopInEmergency
{
  require(msg.value >= getFee());
  Dwitters.push(Dwitt(_messaggio,msg.sender,block.timestamp));
  
  ownerDwitter[msg.sender].push(Dwitters.length - 1);
}

function getgetFee() public view returns(uint){return getFee();}

function getDwitters() public view returns (Dwitt[] memory){return Dwitters;}

function getDwitterId(uint id) public view returns(string memory,address, uint256 ) 
{
  return (Dwitters[id].text,Dwitters[id].owner,Dwitters[id].timestamp );
}

function myDwitter(address myAddress) public view returns(uint[] memory) {return ownerDwitter[myAddress];}


function withdrawDwitter() public virtual onlyOwner stopInEmergency{
    address _owner = owner();
    (bool sent, bytes memory data) = _owner.call{value:address(this).balance}("");
    require(sent, "Failed to send Ether");
  }
 function getStopped() public view returns(bool){return stopped;}

   function setCircuitBreaker() public virtual onlyOwner{
        stopped = !stopped;
    }
}
